import React from 'react';
import { FaWhatsapp, FaInstagram, FaFacebook, FaEnvelope } from 'react-icons/fa';
import './Contato.css';

function Contato() {
  return (
    <div className="contato-page">
      <h1 className="contato-title">Entre em contato conosco</h1>
      <div className="contato-links">
        {/* Link do WhatsApp */}
        <div className="contato-link">
          <FaWhatsapp className="contato-icon" />
          <span>(99) 99999-9999</span>
        </div>
        
        {/* Link do Instagram */}
        <div className="contato-link">
          <FaInstagram className="contato-icon" />
          <span>@aloha_turismo</span>
        </div>
        
        {/* Link do Facebook */}
        <div className="contato-link">
          <FaFacebook className="contato-icon" />
          <span>/AlohaTurismo</span>
        </div>
        
        {/* Link do E-mail */}
        <div className="contato-link">
          <FaEnvelope className="contato-icon" />
          <span>contato@alohaturismo.com</span>
        </div>
      </div>
    </div>
  );
}

export default Contato;
